import React, { FunctionComponent, useState } from 'react';
import { Pockemon } from './pockemon';
import mockPockemons from './mock-pockemon';

const App: FunctionComponent = () => {
    // état typé pour la liste de pockemons
    const [pockemons, setPockemons] = useState<Pockemon[]>(mockPockemons);

    return (
        <div>
            <h1>Liste des Pockemons</h1>
            <ul>
                {pockemons.map(p => (
                    <li key={p.id}>{p.name} — {p.type} (lvl {p.level})</li>
                ))}
            </ul>
        </div>
    );
};

export default App;
